import React from 'react';
import { FaShoppingCart, FaSearch, FaFacebookF, FaTwitter, FaInstagram, FaLinkedinIn, FaMapMarker, FaArrowRight } from 'react-icons/fa';

const Home = () => {
  return (
    <div className="relative">
    {/* Red Bar with Upside-Down Triangle */}
    <div className="bg-red-600 text-white text-center py-2 text-sm relative">
      {/* Red Triangle Effect */}
      <div className="absolute left-0 top-0 h-full w-[100px] bg-red-600 transform -skew-x-[30deg] -translate-y-1/2"></div>
      <span>Free Delivery on all orders Over $50</span>
    </div>
  
    {/* Navbar */}
    <nav className="bg-[#010f1c] flex items-center justify-between py-4 px-8">
      {/* Logo */}
      <div className="flex items-center space-x-4">
        <img src="/path-to-logo.png" alt="Pizza Logo" className="h-10" />
      </div>
      {/* Centered Links */}
      <ul className="flex space-x-8">
        <li className="text-white">HOME</li>
        <li className="text-white">MENU</li>
        <li className="text-white">SHOP</li>
        <li className="text-white">PAGES</li>
        <li className="text-white">NEWS</li>
        <li className="text-white">CONTACT US</li>
      </ul>
      {/* Icons & Button */}
      <div className="flex space-x-4 items-center">
        <FaSearch className="text-white" />
        <FaShoppingCart className="text-white" />
        <button className="bg-red-600 text-white px-4 py-2 rounded-sm hover:bg-red-700">
          BOOK A TABLE <FaArrowRight />
        </button>
      </div>
    </nav>
  </div>
  
  );
};

export default Home;
